import React from 'react';
import { Nav, Navbar, Form, FormControl, NavDropdown, Button } from 'react-bootstrap';
import styled from 'styled-components';
import './footer.css'
//import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  useParams,
} from "react-router-dom";

const Styles = styled.div`
.navbar { background-color: #222; }
a, .navbar-nav, .navbar-light .nav-link {
  color: #9FFFCB;
  &:hover { color: white; }
}
.navbar-brand {
  font-size: 1.4em;
  color: #9FFFCB;
  &:hover { color: white; }
}
.form-center {
  position: absolute !important;
  left: 25%;
  right: 25%;
}
`;

export const Footer = () => (
  <div>
  <div className="row">
      <div className="col-md-12">
          <Router>
              <Navbar className="color-nav" variant="dark" expand="lg" sticky="bottom">
                  <Navbar.Brand href="/">COV-IDEAS REU 2020</Navbar.Brand>
                  <Navbar.Toggle aria-controls="basic-navbar-nav" />
                  <Navbar.Collapse id="basic-navbar-nav">
                      <Nav className="ml-auto">
                      <Nav.Link href="/">Home</Nav.Link>
                      <Nav.Link href="/about">About</Nav.Link>
                      <NavDropdown alignRight='true' title="Projects" id="dropdown-menu-align-right">
                      <NavDropdown.Item href="/aggregators">Aggregators </NavDropdown.Item>
                      <NavDropdown.Item href="/modelgroup">Modelling</NavDropdown.Item>
                      </NavDropdown>

                      </Nav>
                  </Navbar.Collapse>
              </Navbar>


          </Router>
      </div>
  </div>
</div>
)
